        const string cuLib = "libCUFaceRecognizerd.so";

        [DllImport(cuLib, CallingConvention = CallingConvention.Cdecl)]
        public static extern IntPtr CreateCURecognizer();

        [DllImport(cuLib, CallingConvention = CallingConvention.Cdecl, CharSet = CharSet.Ansi)]
        public static extern bool Init(IntPtr pRecognizer, StringBuilder config, bool initAsync);

        [DllImport(cuLib, CallingConvention = CallingConvention.Cdecl, CharSet =CharSet.Ansi)]
        public static extern ResultCode FaceExtraction(IntPtr pRecognizer, byte[] jpgData, int imageLen, IntPtr retValue, byte[] embedding, int size);

        [DllImport(cuLib, CallingConvention = CallingConvention.Cdecl, CharSet = CharSet.Ansi)]
        public static extern float MatchFeature(IntPtr pRecognizer, byte[] srcFeature, int srcLength, byte[] desFeature, int desLength);

        [DllImport(cuLib, CallingConvention = CallingConvention.Cdecl)]
        public static extern void DisposeCURecognizer(IntPtr pRecognizer);

